@ShayYeger או, יש לי שאלות...
מה עושים שם כמה ימים? הרי גם ככה קים מקבל כל החלטה שירצה, ואם מישהו יגיד משהו בכיוון הלא נכון, אפילו שהוא לא יודע שזה הכיוון הלא נכון- כבר לא יהיה בחיים יותר.
אז על מה יש לטחון מים כל כך הרבה?

@bardugojacob איך יודעים שהביביסטים במצוקה אמיתית?

מה שנשאר להם זה לטחון את השכל על מינוי של ספרן. 

המשיכו כך.

@YinonMagal קרס כבר מזמן. 
למה אתה אובססיבי כל כך לטחון את ההריסות.
לך תרקוד בשקט עם ריקלין.
